#include <fstream>

using namespace std;

int main() {
  ifstream fin("tort.in");
  ofstream fout("tort.out");
  int m, n, mn, l;
  fin >> m >> n;
  mn = m < n ? m : n;
  for (l = mn; l >= 1; l--) {
    if (m % l == 0 && n % l == 0) {
      fout << m / l * n / l << ' ' << l << '\n';
      break;
    }
  }
  return 0;
}
